package prime;

public class way {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int ct=0,n=0,i=1,j=1;
		while(n<50)
		{
			j=i;
			ct=0;
			while(j<=i)
			{
				if(i%j==0)
				ct++;
				j++;
			}
			if(ct==2)
			{
				System.out.println(i);
				n++;
			}
			i++;
		}
	}
	}
